import React, { Component } from 'react'

class course extends Component {
    constructor(props) {
        super(props)

        this.state = {
             message : "himanshu lodu"
        }
    }

    render() {

        return (
            <div>
                <h1>{this.state.message}</h1>
            </div>
        )
    }
}
export default course
